import React from 'react';
import Table from './Table';

const TransactionTable = ({ transactions }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Date</th>
          <th>Description</th>
          <th>Category</th>
          <th>Amount</th>
        </tr>
      </thead>
      <tbody>
        {transactions.map((transaction, index) => (
          <Table key={index} transaction={transaction} />
        ))}
      </tbody>
    </table>
  );
};

export default TransactionTable;
